import React from 'react';
import './App.css';
import SearchComponent from "./Components/SearchComponent";
import { Container, Row, Col } from 'react-bootstrap';

class ScoutSearch extends React.Component {
  render() {
    return (
        <Container>
          <Row>
            <Col style={{'paddingBottom': '2em'}}>
              <h1>3322 Scouting Application</h1>
            </Col>
          </Row>
          <Row>
            <Col style={{'paddingLeft': 0}}>
              <SearchComponent/>
            </Col>
          </Row>
        </Container>
    )
  }
}

export default ScoutSearch;
